import React, { Component } from 'react'
import weatherConfig from '../config/config'

export default class WeatherBox extends Component {

    constructor(props){
        super(props);

        this.state={
            apiURL: weatherConfig.weatherData.apiURL,
            apiKey: weatherConfig.weatherData.apiKey,
            cities: weatherConfig.weatherData.weatherCities,
            citiesIDs: []
        }
    }

    getCitiesID(){
        const {cities} = this.state;
        let myCitiesID= cities.map((item) => {
            return item.city.id;
        });
        this.setState({
            citiesID: myCitiesID
        })
    }

    componentDidMount(){
    }

    render() {
        const {cities} = this.state.cities;
        return (
            <div>
                {cities.city}
            </div>
        )
    }
}
